import React from 'react';

import {About, Footer, Header, Skills, Testimonials, Work} from './container';
import { Navbar } from './component';
import './App.scss';
const App = () => {
  return (
    <div>
      <Navbar />
      <Header />
      <About />
      <Work />
      <Skills />
      <Testimonials />
      <Footer />
    </div>
  );
}

export default App;
